import React from "react";
import {cities} from "../constants";
import styles from "./NavBar.module.css"

function NavBar(){

    return (
        <div className={styles}>
         <button>{"<<"}</button>
         {cities.map((_,index)=>(
            <idv>
                <button>{cities[index]}</button>
            </idv>
         ))}
         <button>{">>"}</button>
        </div>
    );

}
export default NavBar;
